<div class="entities" style="line-height: 2.5; direction: ltr">Isolation , partial purification and characterization of nuclear retinoic acid receptors from chick skin . Nuclear receptors ( RARs ) for retinoic acid ( RA ) are considered to be the ultimate mediators of the action of RA in the control of cell differentiation and inhibition of tumorigenesis . We have isolated and partially purified and characterized RAR from a RA-responsive tissue , chick embryo skin . The purification steps included Affi-Gel blue chromatography , ultrafiltration , size exclusion chromatography , and preparative isoelectric focusing . The electrofocusing of RAR - [ 3H ] RA complex in ampholines ( pH 3-10 ) revealed that the receptors have an isoelectric pH of 7.5 . Whereas pronase-digested the RAR - [ 3H ] RA complex completely , DNase showed 20-35 % and RNase showed negligible digestive action on the complex . The ligand binding to RAR was completely inhibited by a mercury compound .

<div class="entities" style="line-height: 2.5; direction: ltr">Androgen receptors in the posterior bed nucleus of the stria terminalis increase neuropeptide expression and the stress-induced activation of the paraventricular nucleus of the hypothalamus . The posterior bed nuclei of the stria terminalis ( BST ) are important neural substrate for relaying limbic influences to the paraventricular nucleus ( PVN ) of the hypothalamus to inhibit hypothalamic-pituitary-adrenal (

 ) 65 and

 67 mRNA were analyzed in the posterior BST to test a local involvement of GABA . There were no changes in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 expression to support a GABA-related mechanism in the BST . For PVN neuropeptide expression and Fos responses , basic effects were lateralized to the sides of the PVN ipsilateral to the implants . However , opposite to our expectations of an inhibitory influence of androgen receptors in the posterior BST , PVN AVP mRNA and stress-induced Fos were augmented in response to DB02901 and attenuated in response to HF . These results suggest that a subset of androgen receptor-expressing cells within the posterior BST region may be responsible for increasing the biosynthetic capacity and stress-induced drive of PVN motor neurons .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">SHP 2 is a target of the immunosuppressant tautomycetin . SHP 2 phosphatase is a positive transducer of growth factor and cytokine signaling . SHP 2 is also a bona fide oncogene ; gain-of-function SHP 2 mutations leading to increased phosphatase activity cause Noonan syndrome , as well as multiple forms of leukemia and solid tumors . We report that tautomycetin ( Q8WZ42 ) , an immunosuppressor in organ transplantation , and its engineered analog Q8WZ42 D - 1 are potent SHP 2 inhibitors . Q8WZ42 and Q8WZ42 D - 1 block T cell receptor-mediated tyrosine phosphorylation and

</mark>
 activation and gain-of-function mutant SHP 2 - induced hematopoietic progenitor hyperproliferation and monocytic differentiation . Crystal structure of the SHP 2  Q8WZ42 D - 1 complex reveals that Q8WZ42 D - 1 occupies the SHP 2 active site in a manner similar to that of a peptide substrate . Collectively , the data support the notion that SHP 2 is a cellular target for Q8WZ42 and provide a potential mechanism for the immunosuppressive activity of Q8WZ42 . Moreover , the structure furnishes molecular insights upon which therapeutics targeting SHP 2 can be developed on the basis of the Q8WZ42 scaffold .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Detection of multiple antibodies in myasthenia gravis and its clinical significance . BACKGROUND : Antibodies against acetylcholine receptor , acetylcholinesterase , ryanodine receptor and titin have been found in patients with myasthenia gravis . However , the relations between these antibodies and character of myasthenia gravis are unknown . This study aimed to detect multiple antibodies in myasthenia gravis and to investigate its clinical significance . METHODS : These antibodies were detected by enzyme-linked immunoabsorbent assay in 89 cases of myasthenia gravis , 66 cases of other neurological diseases and 66 healthy controls . The incidences of antibodies were compared using the chi-square test . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB03128
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 receptor , acetylcholinesterase , titin and ryanodine receptor antibodies were detected in 53.9 % , 20.2 % , 64.0 % and 55.0 % of myasthenia gravis patients respectively , higher than in patients of other neurological diseases and controls groups . The combination of the four antibodies assays provided 94.4 % sensitivity and 84.0 % specificity for the diagnosis of myasthenia gravis . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P22303
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antibody occurred more frequently in acetylcholine receptor antibody negative patients with adverse reactions to neostigmine test . Q8WZ42 antibody provided 82.1 % sensitivity and 52.5 % specificity for myasthenia gravis with thymoma . Incidences of titin and of ryanodine receptor antibody were higher in late onset myasthenia gravis than in early onset myasthenia gravis . The proportion of titin antibody positive patients increased with the severity of myasthenia gravis as graded by a modified Osserman scale . CONCLUSIONS : Testing for acetylcholine receptor , acetylcholinesterase , titin and ryanodine receptor antibodies can offer a better diagnostic method for myasthenia gravis than each antibody test alone . Q8WZ42 antibody combined with computed tomography was better for the diagnosis of thymoma . Q8WZ42 antibody occurred most frequently in severe myasthenia gravis .</div>

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04860
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , an agonist of Q9NYK1 , reduces plasma virus concentration in chronic hepatitis C infection . Immune-based therapy is the mainstay treatment for chronic hepatitis C virus ( HCV ) infection but causes multiple side effects and achieves durable viral clearance in only approximately 50 % of patients . Most new investigational anti-HCV compounds are direct-acting antivirals for which durability of response and risk of viral mutations and resistance are not yet known . Therefore , continuing discovery and development of new immune-based treatments is desirable . Toll-like receptors ( TLRs ) are pathogen recognition receptors that initiate the innate immune response . The responsiveness of HCV or other ongoing chronic systemic infections to treatment with a selective TLR agonist has not been reported . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04860
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is a selective agonist of Q9NYK1 . In a proof-of-concept study , we found that once-daily 7 - day treatment with intravenous isatoribine 800 mg caused a significant ( P = . 001 ) reduction of plasma HCV RNA ( mean , -0.76 ; range , -2.85 to +0.21 log ( 10 ) units ) in otherwise untreated patients ( n = 12 ) who were chronically infected with HCV . Viral load reduction occurred in patients infected with genotype 1 as well as non-genotype 1 HCV . The reduction of viral load was correlated with induction of markers of a heightened immune antiviral state , including 2 ' - , 5 ' - oligoadenylate synthetase levels in whole blood . This treatment was well tolerated , with a low frequency of mild to moderate adverse events . In conclusion , systemic administration of the selective Q9NYK1 agonist isatoribine resulted in dose-dependent changes in immunologic biomarkers and a statistically significant antiviral effect with relatively few and mild side effects .</div>

<h2 style="margin: 0">16</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Development of fulminant Type 1 diabetes with thrombocytopenia after influenza vaccination : a case report . BACKGROUND : Fulminant Type 1 diabetes was originally reported as idiopathic Type 1 diabetes . Involvement of viral infections in the pathogenesis of fulminant T1D has been suggested , but the development of fulminant Type 1 diabetes after influenza vaccination has not been reported . CASE REPORT : We report a case of fulminant Type 1 diabetes with thrombocytopenia following influenza vaccination . A 54 - year-old man was admitted to hospital with hyperglycaemia and diabetic ketosis . Seven days before admission , he received a seasonal influenza vaccine for the prevention of influenza infection . On admission , blood glucose was 29 mmol / L and HbA 1c 40 mmol / mol ( 5.9 % ) . Fasting and 2 - h C-peptide immunoreactivity were &lt; 0.0333 nmol / L and 0.0999 nmol / L , respectively . Anti - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99259
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and anti-IA - 2 antibodies were negative , so no autoimmunity seemed to participate in the etiology . ELISPOT assay also showed no association with T cell-mediated autoimmunity . HLA genotypes were consistent with susceptibility to fulminant Type 1 diabetes . After the abrupt onset of diabetes , he showed mild thrombocytopenia , which has been observed for approximately 5 years after diabetes development . CONCLUSION : This is the first description of fulminant Type 1 diabetes after influenza vaccination . Our observation raises the possibility that influenza vaccination might trigger this condition via the Q9NYK1 pathway .</div>

<h2 style="margin: 0">17</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacokinetic profiles of the novel 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( CX ) is a novel imidazole derivative that is a cyclo-oxygenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P36551

</mark>
 ) - 2 selective non-steroidal anti-inflammatory drug and the latest 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 selective inhibitor to be released for veterinary use . Currently there is limited information available on the pharmacokinetic ( PK ) properties of CX . The aim of the current study was to evaluate the PK features of CX after administration of the recommended dose and after administration of a more variable dose rate in the form of the commercially available tablet . In addition , the effects of food intake on the PK properties were also evaluated . In the first study , five healthy Beagle dogs received 2mg / kg CX via the oral route following a period of fasting . The second study was conducted using six healthy Labrador retriever dogs which each received an 80 mg tablet ( approximate dose 1.95- 2.5 mg / kg ) using a crossover design , both in the fasted and fed condition . The plasma concentrations of CX were detected by a validated HPLC method . No adverse effects were observed in any dogs during the experiment . The results from the PK analysis were similar between the studies , regardless of precision of dose and fasted and fed conditions . The mean peak concentration of CX was 0.49 and 0.43 g / mL under fasted and fed conditions , respectively . The mean half-life was about 3h after all treatments . In addition , simulated multiple dosing data revealed that time over minimal effective concentration was similar after 1.95 , 2.0 and 2.5 mg / kg dose administrations . These findings suggest that slight variation from the recommended dose should not alter the therapeutic outcome . In addition , CX can be administered to fed dogs without significantly affecting blood levels .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Differential expression of retinoic acid receptor-beta isoforms during chick limb ontogeny . Retinoids influence both morphogenetic events and differentiation during development of the vertebrate limb . These effects are mediated through nuclear retinoid receptors , which modulate target gene expression . We report here the cloning and characterization of three promoter - and splicing-variants of the retinoic acid receptor-beta ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10826
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) from chick . These receptor isoforms are independently expressed during limb development . RAR beta 2 but not RAR beta 1 transcripts are enriched three-fold in the posterior limb bud , reflecting the increased RA concentrations in this region . RAR beta 1 transcripts are initially present throughout the limb bud mesenchyme and ectoderm , then become restricted within perichondrial regions and loose connective tissue of the limb . RAR beta 1 expression closely overlaps that of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13591
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( neural cell adhesion molecule ) and tenascin in non-neuronal tissues . RAR beta 2 transcripts are present within a subset of those limb tissues which express RAR beta 1 . In the early limb bud RAR beta 2 transcripts are detected in proximal limb mesenchyme and in the initial mesenchymal condensate . In older limbs RAR beta 2 mRNAs are abundant in cells lateral to the digit cartilage . Neither RAR beta 1 nor RAR beta 2 transcripts are associated specifically with regions of limb cell death . The differential expression and regulation of RAR beta isoforms suggests these variants may have different roles in limb development .</div>
